import css from 'styled-jsx/css';

export default css`.solution-card {
  width: 301px;
  height: 219px;
  display: inline-block;
  background-color: #fff;
}
.solution-card .pic-wrap {
  width: 301px;
  height: 124px;
  overflow: hidden;
}
.solution-card .pic-wrap img {
  width: 301px;
  height: 124px;
}
.solution-card p {
  height: 23px;
  font-size: 24px;
  font-family: Source Han Sans CN;
  font-weight: 400;
  color: #666666;
}
`
